import React from "react";
import { useState, useEffect } from "react";

import {
  Dialog,
  DialogContent,
  TextField,
  Box,
  Button,
  Typography,
  styled,
} from "@mui/material";
const Component = styled(DialogContent)`
  height: 55vh;
  width: 90vh;
  padding: 0;
  padding-top: 0;
`;
const CreateAccount = styled(Typography)`
  margin: auto 0 5px 0;
  text-align: center;
  color: #2874f0;
  font-weight: 600;
  font-size: 14px;
  cursor: pointer;
`;
const RequestOTP = styled(Button)`
  text-transform: none;
  background: #fff;
  color: #2874f0;
  height: 48px;
  border-radius: 2px;
  box-shadow: 0 2px 4px 0 rgb(0 0 0 / 20%);
`;
const Text = styled(Typography)`
  color: #878787;
  font-size: 12px;
`;
const LoginButton = styled(Button)`
  text-transform: none;
  background: #fb641b;
  color: #fff;
  height: 48px;
  border-radius: 2px;
`;

function LoginDialog({ open, setOpen }) {
  const handleClose = () => {
    setOpen(false);
    // toggleAccount(accountInitialValues.login);
  };
  return (
    <Dialog open={open} onClose={handleClose}>
      <Component>
        <Box>

        </Box>
       
      </Component>
    </Dialog>
  );
}

export default LoginDialog;
